(379, 308, 'Logo', 18, '', '<p>\r\n	<a href="http://123deals.vn/demo"><img alt="" border-bottom-style:="" border-bottom-width:="" border-left-style:="" border-left-width:="" border-right-style:="" border-right-width:="" border-top-style:="" src="/demo/templates/pictures/content/logo-deals.png" /></a></p>\r\n', 0, '', 'template', '', '', 0, '', 0, '', '', '', ''),
(459, 383, 'Iphone 4s', 18, 'Trong sự kiện "Let''s Talk iPhone" Apple đã chính thức giới thiệu iPhone thế hệ mới của mình. iPhone 4S được trình làng\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '<p style="text-align: justify;">\r\n	<span style="font-size:14px;">Nhận diện giọng n&oacute;i, một trong những n&acirc;ng cấp được Apple n&oacute;i nhiều.</span></p>\r\n<p class="Normal" style="text-align: justify;">\r\n	<span style="font-size:14px;">N&acirc;ng cấp đ&aacute;ng ch&uacute; &yacute; thứ hai ở 4S so với iPhone 4 l&agrave; việc cảm biến của m&aacute;y ảnh được tăng từ 5 Megapixel l&ecirc;n 8 Megapixel với độ mở f2.4 cho chất lượng h&igrave;nh ảnh sắc n&eacute;t hơn. Cấu h&igrave;nh &quot;l&otilde;i k&eacute;p&quot; c&ugrave;ng cảm biến mới cho ph&eacute;p thu được &aacute;nh s&aacute;ng nhiều hơn 73% v&agrave; c&oacute; tốc độ chụp nhanh hơn 1/3 so với người tiền nhiệm</span></p>\r\n<p class="Normal" style="text-align: justify;">\r\n	<span style="font-size:14px;">Theo giới thiệu, iPhone 4S chỉ mất 1,1 gi&acirc;y để chụp bức ảnh đầu ti&ecirc;n v&agrave; nửa gi&acirc;y cho bức ảnh thứ hai. Ngo&agrave;i ra chế độ quay phim tr&ecirc;n m&aacute;y cũng hỗ trợ chất lượng lưu trữ đạt chuẩn Full HD 1.080p đi k&egrave;m nhiều chế độ t&ugrave;y chỉnh kỹ thuật.</span></p>\r\n<p class="Normal" style="text-align: justify;">\r\n	<span style="font-size:14px;">Đi k&egrave;m với hệ điều h&agrave;nh iOS 5, iPhone 4S được t&iacute;ch hợp chế độ điều khiển bằng giọng n&oacute;i với c&ocirc;ng nghệ Siri, hỗ trợ c&aacute;c ng&ocirc;n ngữ Anh, Ph&aacute;p v&agrave; Đức, hoạt động tr&ecirc;n nhiều ứng dụng kh&aacute;c nhau. Người d&ugrave;ng chỉ cần giữ ph&iacute;m Home để khởi động chức năng n&agrave;y.</span></p>\r\n<p class="Normal" style="text-align: justify;">\r\n	<span style="font-size: 14px;"><img alt="" src="/demo/templates/pictures/content/505267fd-5d46-4613-8be1-ae27ad43c0f5.jpg" style="width: 500px; height: 304px;" /></span></p>\r\n<table cellpadding="0" cellspacing="0" class="specification" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td class="title" colspan="2">\r\n				Th&ocirc;ng Tin Cơ Bản</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="name">\r\n				K&iacute;ch Cỡ</td>\r\n			<td class="desc">\r\n				115.2 x 58.66 x 9.3 mm &nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="name">\r\n				Trọng Lượng</td>\r\n			<td class="desc">\r\n				140 gram &nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="name">\r\n				Hệ Điều H&agrave;nh</td>\r\n			<td class="desc">\r\n				IOS 5 &nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="name">\r\n				Loại Pin</td>\r\n			<td class="desc">\r\n				- Gọi li&ecirc;n tục 8 tiếng - Sử dụng internet 3G li&ecirc;n tục 6 tiếng - Xem video li&ecirc;n tục 10 tiếng - Nghe nhạc li&ecirc;n tục 40 tiếng &nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="name">\r\n				Thời Gian Gọi</td>\r\n			<td class="desc">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="name">\r\n				Thời Gian Chờ</td>\r\n			<td class="desc">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="name">\r\n				B&agrave;n Ph&iacute;m, Thiết Bị Tương T&aacute;c</td>\r\n			<td class="desc">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="name">\r\n				Ng&ocirc;n Ngữ</td>\r\n			<td class="desc">\r\n				Tiếng Anh<br />\r\n				Tiếng Việt<br />\r\n				Tiếng Trung<br />\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="title" colspan="2">\r\n				<img id="ctl01_ctl01_ctl00_ctl00_ctl01_rptGroups_ctl03_imgIcon" src="http://www.chuyeniphone.net/ImageService.ashx?imageURL=%5CUserFiles%5CImage%5CIMGcb1eaa5e9dc44a7fa24637009d52fcf8.jpg&amp;maxWidth=30&amp;maxHeight=30" style="border-width:0px;" /> Chức Năng Giải Tr&iacute;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="name">\r\n				M&aacute;y Ảnh</td>\r\n			<td class="desc">\r\n				Camera 8.0mp &nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="name">\r\n				Quay Phim</td>\r\n			<td class="desc">\r\n				Full HD 1080 &nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="name">\r\n				Xem Phim</td>\r\n			<td class="desc">