e;m</td>\r\n			<td class="desc">\r\n				Sạc,C&aacute;p,Tai nghe &nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n', 0, '', 'product', '', '', 0, '', 19500000, '<p>\r\n	<span style="font-size:14px;"><a href="http://www.123deals.vn">iPhone 4S</a> được n&acirc;ng cấp về hiệu năng với chip l&otilde;i k&eacute;p A5 giống như iPad 2 thay cho chip l&otilde;i đơn A4.</span></p>\r\n<p>\r\n	<span style="font-size:14px;">Theo giới thiệu bộ xử l&yacute; đồ họa của 4S cũng c&oacute; cấu tr&uacute;c l&otilde;i k&eacute;p. Trang bị mới cho ph&eacute;p iPhone 4S hoạt động nhanh gấp 7 lần model tiền nhiệm.</span></p>\r\n<p>\r\n	<span style="font-size:14px;">Một thay đổi nhỏ nữa l&agrave; việc <a href="http://www.123deals.vn">iPhone 4S</a> sẽ được n&acirc;ng tốc độ tải dữ liệu tr&ecirc;n mạng 3G nhanh gấp đ&ocirc;i, đạt 14,4 Mb/gi&acirc;y. Với những trang bị mới, Apple vẫn đảm bảo thời lượng pin sử dụng với 8 giờ đ&agrave;m thoại tr&ecirc;n mạng 3G, 14 giờ đ&agrave;m thoại tr&ecirc;n mạng 2G, lướt web với 3G trong 6 giờ hay 9 giờ với chế độ Wi-Fi (theo l&yacute; thuyết)...</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n', '<p>\r\n	<span style="font-size:16px;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Chỉ cần lick v&agrave;o n&uacute;t &quot;mua&quot; v&agrave; điền đầy đủ th&ocirc;ng tin l&agrave; qu&yacute; kh&aacute;ch đ&atilde; c&oacute; cơ hội sở hữu<br />\r\n	ngay chiếc iphone 4s s&agrave;nh điệu. Hệ thống sẽ chọn ra 1 kh&aacute;ch h&agrave;ng c&oacute; số lần đặt mua cao<br />\r\n	nhất để trao giải. 123deals.vn sẽ chũ đ&ocirc;ng li&ecirc;n lạc với kh&aacute;ch h&agrave;ng may mắn nhận được<br />\r\n	Iphone 4s trị gi&aacute; 0đ.</span></p>\r\n', '', '24 Hoàng Việt, Phường 4, Quận Tân Bình, TPHCM'),
(458, 382, 'Vé trận đấu FC.Bảo Kim vs FC.DKT', 18, 'Giảm giá 50% cho người thân của cầu thủ 2 bên\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '<p>\r\n	sức n&oacute;ng đ&atilde; tỏa tới b&aacute;o B&oacute;ng Đ&aacute;.vn<br />\r\n	&nbsp;tu&acirc;nVĐ sau khi ph&aacute;t biểu lung tung tr&ecirc;n b&aacute;o đ&atilde; bị x&oacute;a đi<br />\r\n	&nbsp;ph&aacute;t biểu trước b&aacute;o giới, ban qtrị nội dung b&aacute;o b&oacute;ng đ&aacute; cho rằng ph&aacute;t ng&ocirc;n tr&ecirc;n c&oacute; thể k&iacute;ch động những cổ động vi&ecirc;n qu&aacute; kh&iacute;ch<br />\r\n	g&acirc;y ảnh hưởng tới &#39;Thanh To&aacute;n FC&#39;<br />\r\n	&nbsp;n&ecirc;n đ&atilde; gỡ bỏ<br />\r\n	&nbsp;xem file 1 trước file 2</p>\r\n<p>\r\n	<br />\r\n	rất may, ph&oacute;ng vi&ecirc;n b&aacute;o Con Vịt Cồ đ&atilde; kịp chụp lại h&igrave;nh ảnh, gi&uacute;p mọi người hiểu r&otilde; hơn về một cầu thủ đối phương</p>\r\n', 200000, '', 'product', '', '', 0, '', 400000, '<p>\r\n	Hai đội l&agrave; những đối thủ được coi l&agrave; kh&ocirc;ng đội trời chung.</p>\r\n', '<p>\r\n	Tất cả th&agrave;nh vi&ecirc;n DKT v&agrave; Bảo Kim</p>\r\n', '<p>\r\n	Đừng bỏ lỡ cơ hội xem trận đấu đỉnh cao n&agrave;y</p>\r\n', '51 Lê Đại Hành, Phường Lê Đại Hành, Quận Hai Bà Trưng, Thành Phố Hà Nội'),
