x; padding-left: 0px; font-weight: 700; ">Đ&egrave;n đ&aacute; muố</strong>i với nhiều t&iacute;nh năng ưu việt bảo vệ sức khỏe cho bạn v&agrave; những người th&acirc;n y&ecirc;u của bạn. H&atilde;y l&agrave; những người ti&ecirc;u d&ugrave;ng th&ocirc;ng th&aacute;i, h&atilde;y nhanh tay sở hữu&nbsp;<strong style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-weight: 700; ">Bộ sản phẩm Đ&egrave;n đ&aacute; muối Himalaya</strong>&nbsp;n&agrave;y nh&eacute; c&aacute;c bạn !</p>\r\n', 175000, '', 'product', '', '', 0, '', 410000, '<p>\r\n	&nbsp;</p>\r\n<ul style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-right: 0px; padding-left: 0px; list-style-type: none; font-size: 13px; color: rgb(0, 0, 0); font-family: arial; text-align: left; ">\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		Đ&egrave;n đ&aacute; muối được chế tạo thủ c&ocirc;ng từ những khối đ&aacute; muối tinh khiết, h&igrave;nh th&agrave;nh từ c&aacute;ch đ&acirc;y 250 triệu năm v&agrave; được khai th&aacute;c ở độ s&acirc;u hơn 500 yards dưới ch&acirc;n d&atilde;y Himalaya</li>\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		Những chất tự nhi&ecirc;n trong c&aacute;c tinh thể đ&egrave;n đ&aacute; muối gi&uacute;p giảm mệt mỏi, lo lắng, phiền muộn, suy nhược, t&igrave;nh trạng mất ngủ thường xuy&ecirc;n, dị ứng, đau nửa đầu, cảm lạnh, kh&iacute; thũng, ADHD, ch&agrave;m bội nhiễm.</li>\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		Đ&egrave;n đ&aacute; muối được l&agrave;m thủ c&ocirc;ng bằng tay rất cẩn thận để giữ được sự độc nhất v&agrave; h&igrave;nh dạng đẹp tự nhi&ecirc;n của khối đ&aacute;</li>\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		Với nhiều h&igrave;nh d&aacute;ng, kiểu c&aacute;ch, đế l&agrave;m bằng gỗ thi&ecirc;n nhi&ecirc;n v&agrave; chiếu s&aacute;ng bằng b&oacute;ng sợi đốt, &aacute;nh s&aacute;ng của đ&egrave;n đ&aacute; muối rực rỡ v&agrave; ấm &aacute;p, y&ecirc;n b&igrave;nh v&agrave; nhẹ nh&agrave;ng</li>\r\n</ul>\r\n', '<p>\r\n	&nbsp;</p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(80, 80, 80); clear: left; font-size: 13px; line-height: 18px; font-family: arial; text-align: left; ">\r\n	<strong style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-weight: 700; ">VOUCHER TRỊ GI&Aacute; 410.000 VNĐ</strong></p>\r\n<ul style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-right: 0px; padding-left: 0px; list-style-type: none; font-size: 13px; color: rgb(0, 0, 0); font-family: arial; text-align: left; ">\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		Hạn sử dụng:&nbsp;<b style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; ">đến hết ng&agrave;y 11/1/2012.</b></li>\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		&Aacute;p dụng cho tất cả c&aacute;c sản phẩm đ&egrave;n đ&aacute; muối c&oacute; tại cửa h&agrave;ng.</li>\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		Kh&ocirc;ng &aacute;p dụng cho ng&agrave;y&nbsp;<strong style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-weight: 700; ">Lễ, tết</strong>&nbsp;v&agrave; c&aacute;c chương tr&igrave;nh khuyến mại kh&aacute;c.</li>\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		Tối đa 1 Voucher/ bộ sản phẩm (1 sản phẩm đ&egrave;n đ&aacute; muối 2kg; 1 đế gỗ hoặc gốm; 1 d&acirc;y điện; 1 triết &aacute;p; 1 b&oacute;ng đ&egrave;n c&oacute; thể chọn mầu theo sở th&iacute;ch: v&agrave;ng , trắng, đỏ). Với mỗi kg đ&egrave;n đ&aacute; muối tiếp theo t&iacute;nh gi&aacute; l&agrave; 180.000 VNĐ/kg.</li>\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		Kh&aacute;ch h&agrave;ng c&oacute; thể mua nhiều voucher để sử dụng.</li>\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		Gi&aacute; tr&ecirc;n voucher đ&atilde; bao gồm VAT.</li>\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		Kh&aacute;ch h&agrave;ng li&ecirc;n hệ khi đến để được phục vụ tốt nhất</li>\r\n	<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-type: disc; list-style-position: initial; list-style-image: initial; color: rgb(80, 80, 80); line-height: 18px; ">\r\n		Kh&ocirc;ng c&oacute; gi&aacute; trị quy đổi th&agrave;nh tiền, kh&ocirc;ng ho&agrave;n trả tiền thừa, kh&ocirc;ng &aacute;p cho mua sản phẩm.</li>\r\n</ul>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(80, 80, 80); clear: left; font-size: 13px; line-height: 18px; font-family: arial; text-align: left; ">\r\n	Kh&aacute;ch h&agrave;ng vui l&ograve;ng đọc kỹ điều kiện voucher trước khi sử dụng dịch vụ.</p>\r\n', '<p>\r\n	81, Nguyễn Lương Bằng, P. Nam Đồng, Q. Đống Đa Điện thoại: (04)35334518, 0983667855</p>\r\n', '81, Nguyễn Lương Bằng, P. Nam Đồng, Q. Đống Đa');
